项目经历:
员工培训平台:无:负责人:本项目是基于Python-Flask框架搭建的员工管理平台，使用Bootstrap+Ajax+JavaScript构建前端 界面与接口交互并使用Jinja2模板引擎渲染HTML文件，使用Vue框架搭建后台管理系统，采用Python 作为开发语言设计并编程实现登陆注册、课程模块、考核模块、学员管理模块功能，利用Mysql实现对 数据的存储，最后使用阿里云服务器+Nginx+Uwsgi+Flask部署上线运行。:1、采用蓝图实现模块化管理程序路由的功能,优化了项目结构,使程序结构更加清晰
2、使用锁定表实现了数据的完整性,使用外键保证数据的关联性,添加了SQL防注入语句保证其安全性,污水COD快速检测与分析系统:无:核心成员:该系统通过电化学方法电解产生羟基自由基(·OH)，羟基自由基(·OH)迅速氧化废水里的有机物羟基自由基(·OH)，水中有机物被羟基氧化时， 工作电极上将有电流变化,电流的变化与水中COD值成比例关系，通过计算电流的变化，便可测出水中COD的含量。该项目目前在中国贵州省遵义市茅台镇部分酒厂污水处理厂进行装置试部署，已成功试点安装并应用于工厂与污水处理厂，取得良好的经济效益。:1、负责记录实验中电流的变化以及相应COD值，采用线性回归中的最小二乘法对实验数据进行分析与拟合，得到拟合函数公式； 
2、负责订阅阿里云物联网平台的模拟设备监听物联网的接口，获取实时的json数据并提取COD值，将数据存储在MYSQL数据库中，然后对数据库中COD值进行分析并生成COD值检测曲线，使用Matplotlib实现COD值检测曲线的可视化处理； ,用户Session智能分析平台:无:负责人:该项目是一个小型的Hadoop大数据处理和分析系统，系统采用Flume采集Web埋点产生的日志数据， 使用Map Reduce对数据进行清洗并下沉至Hdfs建立 Hive数据仓库，针对具体业务和维度进行数据仓 库的建模，最终通过Sqoop将结果数据写入Mysql数据库。:1、使用自定义编写的UDTF函数解析日志数据,将日志数据转换为标准的结构化数据,构建明细的数据层;
2、 通过MapReduceJob清洗脏数据,并对Session进行局部聚合,解决聚合中发生的数据倾斜问题;
3、用Hive进行网站的PV,UV,用户注册数,用户留存率进行多维度分析统计。
